import React, { useState } from 'react';
import {
    Box,
    Grid2,
    Typography,
    Container,
    Button,
    Paper
} from '@mui/material';
import PhotoIcon from '@mui/icons-material/Photo';

const GeneratedImage = () => {
    const [img, setImg] = useState(null);

    return (
        <Paper variant='outlined'>
            <Grid2 container sx={{ px: 4, py: 4 }} spacing={2}>
                <Paper
                    elevation={1}
                    sx={{
                        width: '100%',
                        height: '600px',
                        display: 'flex',
                        justifyContent: 'center',
                        alignItems: 'center'
                    }}>
                    {img ?
                        (<Box component='img' alt='image generate' src='' sx={{ display: 'block', width: '100%', height: '100%' }} />)
                        : <PhotoIcon color='disabled' sx={{ height: '80%', width: 'auto' }} />}
                </Paper>
                <Grid2 container size={{ xs: 12, md: 12 }} sx={{ justifyContent: 'flex-end' }}>
                    <Button variant='outlined' color='primary' >Download</Button>
                </Grid2>
            </Grid2>
        </Paper>
    )
}

export default GeneratedImage
